export class item {
    id?: string;
    naam: string;
    prijs: string;
    beschrijving: string;
    img?: string;
    fabrikant: string;
  
    constructor() {
      this.id = '';
      this.naam = '';
      this.prijs = '';
      this.beschrijving = '';
      this.img = '';
      this.fabrikant = '';
    }
  }
